function Top(props) {
    let css = {
        top : {
            width: '100%',
            height: '70px',
            backgroundColor: 'grey',
            display: 'flex',
            justifyContent: 'space-around',

        },
        topImg : {
            height: '70px',

        },
        ul : {
            listStyleType: 'none',
            width: '450px',
            display: 'flex',
            justifyContent: 'space-between'
        },
        button : {
            width: '100px',
            height: '50px',
            border: 'none',
            borderRadius: '5px',
            backgroundColor: '#3A68B8',
        }
    }

    return (
        <div style={css.top}>
            <img src={props.img} alt="логотип" style={css.topImg}/>
            <ul style={css.ul}>
                <li>Home</li>
                <li>About</li>
                <li>Services</li>
                <li>Blog</li>
                <li>Contact</li>
            </ul>
            <button style={css.button}>Sign In</button>


        </div>
    );
}

export default Top;
